import React from "react";
import { Outlet } from "react-router-dom";
import Grid from "@mui/joy/Grid";
import HomeIcon from "@mui/icons-material/Home";
import BorderAllIcon from "@mui/icons-material/BorderAll";
import AssignmentIcon from "@mui/icons-material/Assignment";
import DateRangeIcon from "@mui/icons-material/DateRange";
import AccountBalanceWalletIcon from "@mui/icons-material/AccountBalanceWallet";
import CalendarMonthIcon from "@mui/icons-material/CalendarMonth";
import ChecklistIcon from "@mui/icons-material/Checklist";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";

export default function Appartamento() {
  return (
    <Grid
      container
      style={{
        height: "100vh",
        width: "100wh",
        overflow: "auto",
      }}
    >
      <Grid
        container
        direction="column"
        justifyContent="flex-start"
        alignItems="center"
        style={{
          height: "100%",
          width: "20%",
          backgroundColor: "rgb(5, 22, 34)",
        }}
      >
        <Grid
          style={{
            height: "30%",
            width: "100%",
            //backgroundColor: "rgb(54, 135, 200)",
          }}
        ></Grid>
        <Grid
          container
          direction="column"
          justifyContent="flex-start"
          alignItems="center"
          style={{
            height: "70%",
            width: "100%",
            //backgroundColor: "rgb(154, 75, 200)",
          }}
        >
          <Grid
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            style={{
              height: "8%",
              width: "80%",
              //backgroundColor: "rgb(94, 175, 70)",
              marginTop: "3%",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "20%",
                //backgroundColor: "rgb(24, 95, 170)",
              }}
            >
              <HomeIcon sx={{ color: "#fcfcfc" }} />
            </Grid>
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "80%",
                //backgroundColor: "rgb(194, 75, 20)",
              }}
            >
              Appartamenti
            </Grid>
          </Grid>
          <Grid
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            style={{
              height: "8%",
              width: "80%",
              //backgroundColor: "rgb(94, 175, 70)",
              marginTop: "3%",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "20%",
                //backgroundColor: "rgb(24, 95, 170)",
              }}
            >
              <BorderAllIcon sx={{ color: "#fcfcfc" }} />
            </Grid>
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "80%",
                //backgroundColor: "rgb(194, 75, 20)",
              }}
            >
              Generale
            </Grid>
          </Grid>
          <Grid
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            style={{
              height: "8%",
              width: "80%",
              //backgroundColor: "rgb(94, 175, 70)",
              marginTop: "3%",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "20%",
                //backgroundColor: "rgb(24, 95, 170)",
              }}
            >
              <AssignmentIcon sx={{ color: "#fcfcfc" }} />
            </Grid>
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "80%",
                //backgroundColor: "rgb(194, 75, 20)",
              }}
            >
              Bacheca
            </Grid>
          </Grid>
          <Grid
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            style={{
              height: "8%",
              width: "80%",
              //backgroundColor: "rgb(94, 175, 70)",
              marginTop: "3%",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "20%",
                //backgroundColor: "rgb(24, 95, 170)",
              }}
            >
              <DateRangeIcon sx={{ color: "#fcfcfc" }} />
            </Grid>
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "80%",
                //backgroundColor: "rgb(194, 75, 20)",
              }}
            >
              Turni
            </Grid>
          </Grid>
          <Grid
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            style={{
              height: "8%",
              width: "80%",
              //backgroundColor: "rgb(94, 175, 70)",
              marginTop: "3%",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "20%",
                //backgroundColor: "rgb(24, 95, 170)",
              }}
            >
              <AccountBalanceWalletIcon sx={{ color: "#fcfcfc" }} />
            </Grid>
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "80%",
                //backgroundColor: "rgb(194, 75, 20)",
              }}
            >
              Spese
            </Grid>
          </Grid>
          <Grid
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            style={{
              height: "8%",
              width: "80%",
              //backgroundColor: "rgb(94, 175, 70)",
              marginTop: "3%",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "20%",
                //backgroundColor: "rgb(24, 95, 170)",
              }}
            >
              <CalendarMonthIcon sx={{ color: "#fcfcfc" }} />
            </Grid>
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "80%",
                //backgroundColor: "rgb(194, 75, 20)",
              }}
            >
              Calendario
            </Grid>
          </Grid>
          <Grid
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            style={{
              height: "8%",
              width: "80%",
              //backgroundColor: "rgb(94, 175, 70)",
              marginTop: "3%",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "20%",
                //backgroundColor: "rgb(24, 95, 170)",
              }}
            >
              <ChecklistIcon sx={{ color: "#fcfcfc" }} />
            </Grid>
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "80%",
                //backgroundColor: "rgb(194, 75, 20)",
              }}
            >
              To-Do
            </Grid>
          </Grid>
          <Grid
            container
            direction="row"
            justifyContent="center"
            alignItems="center"
            style={{
              height: "8%",
              width: "80%",
              //backgroundColor: "rgb(94, 175, 70)",
              marginTop: "3%",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "20%",
                //backgroundColor: "rgb(24, 95, 170)",
              }}
            >
              <AccountCircleIcon sx={{ color: "#fcfcfc" }} />
            </Grid>
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{
                height: "100%",
                width: "80%",
                //backgroundColor: "rgb(194, 75, 20)",
              }}
            >
              <Typography></Typography>

            </Grid>
          </Grid>
        </Grid>
      </Grid>
      <Grid
        style={{
          height: "100%",
          width: "80%",
          backgroundColor: "rgb(44, 135, 50)",
        }}
      >
        <Outlet />
      </Grid>
    </Grid>
  );
}
